import React from "react";
import "./Footer.css";

function Footer() {
  return (
    <div className="footer">
      <p>© 2020 Travel&Stay | No rights reserved</p>
      <p>Privacy · Terms · Company Details</p>
    </div>
  );
}

export default Footer;
